INSERT INTO `wp_commentmeta` VALUES (212562, 74144, 'akismet_as_submitted', 'a:53:{s:15:"comment_post_ID";s:5:"20466";s:14:"comment_author";s:13:"Martha Acosta";s:20:"comment_author_email";s:27:"marthaacostaxon40@lycos.com";s:18:"comment_author_url";s:28:"http://tecnofans.blogbox.be/";s:15:"comment_content";s:777:"I went to sfsu to fight in the AAU friendly tournament and obtained the Gold.I thank to God, my parents, my master and my friends from ccsf for their support.If you are a martial artists and you are laughing at my performance here, I agree that it was really poor. However, I gotta say that it had been 5 years since I last competed in a tournament. Furthermore, I entered the competition with a pulled muscle, my division was closed when I arrived, so I placed on a heavier division and the shin-guards I was wearing were so tight that they were forcing my blood circulation and I didn\'t notice this until the end of the first fight. Never use tight protective gear, the pain on your limbs from cramping is really stressful and your heart works twice as much in half the time.";s:12:"comment_type";s:0:"";s:14:"comment_parent";s:1:"0";s:7:"user_ID";s:1:"0";s:7:"user_ip";s:13:"199.48.147.39";s:10:"user_agent";s:120:"Mozilla/5.0 (Windows; U; Windows NT 6.1; tr-TR) AppleWebKit/533.20.25 (KHTML, like Gecko) Version/5.0.4 Safari/533.20.27";s:8:"referrer";s:45:"http://stuyspectator.com/wp-comments-post.php";s:4:"blog";s:24:"http://stuyspectator.com";s:9:"blog_lang";s:5:"en_US";s:12:"blog_charset";s:5:"UTF-8";s:9:"permalink";s:60:"http://stuyspectator.com/2013/05/11/both-sides-of-the-fence/";s:21:"akismet_comment_nonce";s:6:"passed";s:11:"POST_author";s:13:"Martha Acosta";s:10:"POST_email";s:27:"marthaacostaxon40@lycos.com";s:8:"POST_url";s:28:"http://tecnofans.blogbox.be/";s:11:"POST_submit";s:14:"Submit Comment";s:20:"POST_comment_post_ID";s:5:"20466";s:19:"POST_comment_parent";s:1:"0";s:26:"POST_akismet_comment_nonce";s:10:"0b263029d4";s:12:"POST_comment";s:777:"I went 